	"fin/re/conmgmts1/view/contractstermblocks/Timeline.view.xml":'<!--\n\n    Copyright (C) 2009-2017 SAP SE or an SAP affiliate company. All rights reserved.\n\n-->\n<mvc:View xmlns:mvc="sap.ui.core.mvc"\n          busy="{tiemlineview>/busy}"\n          xmlns:timeline = "fin.re.conmgmts1.controls.timeline">\n\t<timeline:TimeLine id = "timeline" next = "true" currentTimeline="{currentTimeline>/currentTimeline}" press="onReminderPopoverButtonPressed" from="{timelineRange>/from}" to="{timelineRange>/to}" items="{timeline>/events}">\n\t\t<timeline:TimeLineItem\n\t\t\t\tdateFrom="{timeline>dateFrom}"\n\t\t\t\tdateTo="{timeline>dateTo}"\n\t\t\t\teventType="{timeline>type}"\n\t\t\t\teventLevel="{timeline>eventLevel}"\n\t\t\t\teventInfo="{timeline>eventInfo}"\n\t\t\t\tnotifDateTo="{timeline>notifDateTo}"\n\t\t/>\n\t</timeline:TimeLine>\n</mvc:View>\n',
	"fin/re/conmgmts1/view/contractstermblocks/TimelinePopover.fragment.xml":'<!--\n\n    Copyright (C) 2009-2017 SAP SE or an SAP affiliate company. All rights reserved.\n\n-->\n<core:FragmentDefinition\n        xmlns:core="sap.ui.core"\n        xmlns:forms="sap.ui.layout.form"\n        xmlns:m="sap.m">\n\t<m:Popover placement="VerticalPreferedTop" showHeader="false" class="sapUiContentPadding">\n\t\t<forms:SimpleForm\n\t\t\t\tid=""\n\t\t\t\tlayout="ResponsiveGridLayout"\n\t\t\t\tlabelSpanL="12"\n\t\t\t\tlabelSpanM="12"\n\t\t\t\tadjustLabelSpan="false"\n\t\t\t\temptySpanL="0"\n\t\t\t\temptySpanM="0"\n\t\t\t\tcolumnsL="3"\n\t\t\t\tcolumnsM="3">\n\n\t\t\t<m:Label text="{i18n>Terms.Timeline.Event.Field.Date}"/>\n\t\t\t<m:Text text="{\n\t\t\t\tpath: \'selectedTimelineEvent>/date\',\n\t\t\t\ttype: \'sap.ui.model.type.Date\',\n\t\t\t\tformatOptions: { style: \'medium\' }\n\t\t\t}"/>\n\n\t\t\t<m:Label text="{i18n>Terms.Timeline.Event.Field.Description}"/>\n\t\t\t<m:Text text="{selectedTimelineEvent>/info}"/>\n\t\t</forms:SimpleForm>\n\t</m:Popover>\n</core:FragmentDefinition>\n',
