	"fin/re/conmgmts1/view/documentblocks/dialog/UploadDocumentDialog.fragment.xml":'<!--\n\n    Copyright (C) 2009-2017 SAP SE or an SAP affiliate company. All rights reserved.\n\n-->\n<core:FragmentDefinition\n        xmlns:l="sap.ui.layout"\n        xmlns:u="sap.ui.unified"\n        xmlns="sap.m"\n        xmlns:core="sap.ui.core">\n    <Dialog  title="{i18n>Document.Upload.DialogTitle}" contentWidth="auto" contentHeight="auto" verticalScrolling="true">\n        <l:VerticalLayout>\n            <u:FileUploader\n                    id="fileUploader"\n                    name="myFileUpload"\n                    useMultipart="true"\n                    multiple="false"\n                    width="400px"\n                    uploadComplete="handleUploadComplete"/>\n\n        </l:VerticalLayout>\n        <buttons>\n            <Button\n                    id = "uploadButton"\n                    text="{i18n>Document.Upload.UploadButton}"\n                    press="handleUploadPress"/>\n            <Button id="closeButton"\n                    text="{i18n>Common.Button.Close}"\n                    press="closeUploadFileDialog"/>\n        </buttons>\n    </Dialog>\n</core:FragmentDefinition>\n',
	"fin/re/conmgmts1/view/partnerblocks/AllPartnerTitle.view.xml":'<!--\n\n    Copyright (C) 2009-2017 SAP SE or an SAP affiliate company. All rights reserved.\n\n-->\n<mvc:View xmlns:mvc="sap.ui.core.mvc" xmlns="sap.m">\n    <FlexBox\n            width="100%"\n            alignItems="Center"\n            justifyContent="Start">\n        <Label text="{i18n>Partner.Label.AllPartnerTitle }" class="" design="Bold" />\n    </FlexBox>\n</mvc:View>\n',
	"fin/re/conmgmts1/view/partnerblocks/MainPartner.view.xml":'<!--\n\n    Copyright (C) 2009-2017 SAP SE or an SAP affiliate company. All rights reserved.\n\n-->\n<mvc:View xmlns:mvc="sap.ui.core.mvc"\n          xmlns:smartForm="sap.ui.comp.smartform"\n          xmlns:smartField="sap.ui.comp.smartfield"\n          xmlns="sap.m" width="100%">\n    <FlexBox\n            width="100%"\n            height="36px"\n            alignItems="Start"\n            justifyContent="Start">\n        <Label text="{i18n>Partner.Label.MainPartnerTitle}" class="" design="Bold" />\n    </FlexBox>\n    <smartForm:SmartForm\n            id="mainPartnerBlock"\n            editTogglable="false"\n            width="100%"\n            editable="false"\n            useHorizontalLayout="true"\n            layout="ResponsiveLayout">\n        <smartForm:Group label="">\n            <smartForm:GroupElement >\n                <smartField:SmartField value="{Xname}"/>\n            </smartForm:GroupElement>\n            <smartForm:GroupElement>\n                <smartField:SmartField value="{Street}"/>\n            </smartForm:GroupElement>\n            <smartForm:GroupElement>\n                <smartField:SmartField value="{TelNumberLong}"/>\n            </smartForm:GroupElement>\n        </smartForm:Group>\n        <smartForm:Group label="">\n            <smartForm:GroupElement>\n                <smartField:SmartField value="{Rltxt}"/>\n            </smartForm:GroupElement>\n            <smartForm:GroupElement>\n                <smartField:SmartField value="{City}"/>\n            </smartForm:GroupElement>\n            <smartForm:GroupElement>\n                <smartField:SmartField value="{Country}"/>\n            </smartForm:GroupElement>\n        </smartForm:Group>\n        <smartForm:Group label="" >\n            <smartForm:GroupElement>\n                <smartField:SmartField showLabel="false"/>\n            </smartForm:GroupElement>\n            <smartForm:GroupElement>\n                <smartField:SmartField value="{MobNumber}"/>\n            </smartForm:GroupElement>\n            <smartForm:GroupElement>\n                <smartField:SmartField value="{SmtpAddr}"/>\n            </smartForm:GroupElement>\n        </smartForm:Group>\n    </smartForm:SmartForm>\n</mvc:View>\n',
	"fin/re/conmgmts1/view/partnerblocks/MorePartner.view.xml":'<!--\n\n    Copyright (C) 2009-2017 SAP SE or an SAP affiliate company. All rights reserved.\n\n-->\n<mvc:View\n        xmlns:smartTable="sap.ui.comp.smarttable"\n        xmlns:mvc="sap.ui.core.mvc"\n        controllerName="fin.re.conmgmts1.controller.partnerblocks.MorePartner"\n        xmlns:l="sap.ui.layout"\n        xmlns="sap.m">\n\n    <smartTable:SmartTable\n            id="partnerList"\n            useTablePersonalisation="true"\n            tableType="ResponsiveTable"\n            editable="false"\n            showRowCount="true"\n            header="{i18n>Partner.TableHeader}"\n            entitySet="ContractPartnerDataSet"\n            class=""\n            useExportToExcel="false"\n            enableAutoBinding="true">\n        <smartTable:customToolbar>\n            <OverflowToolbar>\n                <Select id="partnerListSlice" class=""/>\n                <ToolbarSpacer/>\n            </OverflowToolbar>\n        </smartTable:customToolbar>\n    </smartTable:SmartTable>\n</mvc:View>\n',
